import "./privole.css"

function Privole() {
    return(
        <div className="privole">
            <p>Potpisivanjem ovog obrasca dajem 
                dopuštenje za korištenje i otkrivanje mojih podataka za potrebe ove 
                studije u bilo kojem trenutku u budućnosti.
                
            </p>
            <p>Privola: Pročitao/la sam i razumijem gornji obrazac privole.  
                Klikom na gumb "Kreni s testom!" za ulazak u anketu 
                izražavam svoju spremnost da dobrovoljno sudjelujem u ovoj studiji.</p>

            
        </div>

    )
}

export default Privole;
